import TeamMember from './TeamMember';

function Team() {
    return(
        <div className = "row">
            <TeamMember
                info = {{id : 1,     img : "https://picsum.photos/200",      name : "Afraa Hakouk",         position : "WebDesigner",       phone : "0936593801",       email : "afraa.hakouk.2017@gmail.com",       website : "Cake.com"   ,}}
